/* Theme: sunsetPeach */
@theme reference {
  --color-sunsetPeach-background: 0 0% 100%;
  --color-sunsetPeach-foreground: 0 0% 3.9%;
  --color-sunsetPeach-card: 0 0% 100%;
  --color-sunsetPeach-card-foreground: 0 0% 3.9%;
  --color-sunsetPeach-popover: 0 0% 100%;
  --color-sunsetPeach-popover-foreground: 0 0% 3.9%;
  --color-sunsetPeach-primary: 27 96% 61%;
  --color-sunsetPeach-primary-foreground: 0 0% 98%;
  --color-sunsetPeach-secondary: 33 100% 96%;
  --color-sunsetPeach-secondary-foreground: 0 0% 9%;
  --color-sunsetPeach-muted: 210 40% 96%;
  --color-sunsetPeach-muted-foreground: 0 0% 45.1%;
  --color-sunsetPeach-accent: 32 98% 83%;
  --color-sunsetPeach-accent-foreground: 0 0% 9%;
  --color-sunsetPeach-destructive: 0 72% 51%;
  --color-sunsetPeach-destructive-foreground: 0 0% 100%;
  --color-sunsetPeach-border: 214 32% 91%;
  --color-sunsetPeach-input: 214 32% 91%;
  --color-sunsetPeach-ring: 27 96% 61%;
}

.theme-sunsetPeach {
  --color-background: var(--color-sunsetPeach-background);
  --color-foreground: var(--color-sunsetPeach-foreground);
  --color-card: var(--color-sunsetPeach-card);
  --color-card-foreground: var(--color-sunsetPeach-card-foreground);
  --color-popover: var(--color-sunsetPeach-popover);
  --color-popover-foreground: var(--color-sunsetPeach-popover-foreground);
  --color-primary: var(--color-sunsetPeach-primary);
  --color-primary-foreground: var(--color-sunsetPeach-primary-foreground);
  --color-secondary: var(--color-sunsetPeach-secondary);
  --color-secondary-foreground: var(--color-sunsetPeach-secondary-foreground);
  --color-muted: var(--color-sunsetPeach-muted);
  --color-muted-foreground: var(--color-sunsetPeach-muted-foreground);
  --color-accent: var(--color-sunsetPeach-accent);
  --color-accent-foreground: var(--color-sunsetPeach-accent-foreground);
  --color-destructive: var(--color-sunsetPeach-destructive);
  --color-destructive-foreground: var(--color-sunsetPeach-destructive-foreground);
  --color-border: var(--color-sunsetPeach-border);
  --color-input: var(--color-sunsetPeach-input);
  --color-ring: var(--color-sunsetPeach-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-sunsetPeach {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 27 96% 90%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 32 98% 23%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 27 96% 90%;
  }
}

